// Module for Certificate
var certificateModule = (function () {
    // PUBLIC:
    return {
        generateCertificate: function (data) {

            // create image data
            var imageDataPng = 
                'data:image/png;base64,';
            var imageData = 
                'data:image/jpeg;base64,';

            
            var doc = new jsPDF();

            // add the level
            var level = event.target.getAttribute('level');

            // add image
            doc.addImage(imageDataPng, 'PNG', 15, 20, 180, 260);

            // set font
            doc.setFont("times");

            // add title
            doc.setFontSize(28);
            doc.setTextColor(83, 67, 47);
            doc.text(70, 106, 'Typing Speed & Accuracy');

            // add name
            var name = document.getElementById('modal-name-input').value;
            doc.setFontSize(32);
            doc.text(86, 148, name);

            // add results
            doc.setFontSize(18);
            doc.text(104, 185, 'Level: ' + level);
            doc.text(90, 195, 'Typing Speed: ' + data.wpm + ' WPM');
            doc.text(101, 205, 'Accuracy: ' + data.accuracy + '%');

            // add date & brand
            var certDate = new Date();
            doc.setFontSize(10);
            doc.text(145, 257, 'Date: ' + certDate.toLocaleDateString('en-GB'));
            doc.text(145, 263, 'Produced by: Pebaro' );

            // save document
            doc.save('typing_certificate.pdf');
        },
    };
})();
